Method.Source:
    [Form]
    public class JmgStampJournalTrans extends FormRun
    {
        QueryBuildRange workerRange;
        QueryBuildRange profileDateRange;
}

void init()
{
    super();

    workerRange = jmgStampJournalTrans_ds.query().dataSourceNo(1).addRange(fieldNum(JmgStampJournalTrans, Worker));
    profileDateRange = jmgStampJournalTrans_ds.query().dataSourceNo(1).addRange(fieldNum(JmgStampJournalTrans, ProfileDate));

    Args args = element.args();

    if (args.parmEnum() == NoYes::Yes)
    {
        jmgStampJournalTrans_ds.query().dataSourceNo(1).addRange(fieldNum(JmgStampJournalTrans,Active)).value(queryValue(NoYes::Yes));
    }

    if (args && args.record())
    {
        JmgDate         profileDate;
        JmgWorkerRecId  workerRecId;

        Common record = args.record();
        if (record.TableId == tableNum(JmgStampJournalTable))
        {
            JmgStampJournalTable jmgStampJournalTable = record;
            profileDate = jmgStampJournalTable.ProfileDate;
            workerRecId = jmgStampJournalTable.Worker;
        }
        else if (record.TableId == tableNum(JmgTimeAndAttendanceActivityRegistrationStaging))
        {
            JmgTimeAndAttendanceActivityRegistrationStaging jmgTimeAndAttendanceActivityRegistrationStaging = record;
            profileDate = jmgTimeAndAttendanceActivityRegistrationStaging.TimeProfileDate;
            workerRecId = HCMWorker::findByPersonnelNumber(jmgTimeAndAttendanceActivityRegistrationStaging.WorkerPersonnelNumber).RecId;
        }

        if (workerRecId)
        {
            chooseWorker.value(workerRecId);
            chooseWorker.allowEdit(false);
            chooseProfileDate.dateValue(profileDate);
        }
    }
}

public int active()
{
    int ret;

    ret = super();

    if (ret)
    {
        ShowErrorCausesBtn.enabled(this.jobRegistrationHasErrorCause());
    }

    return ret;
}

private boolean jobRegistrationHasErrorCause()
{
    return JmgStampJournalTrans.QtyError || JmgStampJournalTrans.PdsCWQtyError;
}

public void executeQuery()
{
    JmgWorkerRecId worker = chooseWorker.value();

    workerRange.value(worker ? queryValue(worker) : SysQuery::valueUnlimited());
    if (chooseProfileDate.dateValue())
    {
        profileDateRange.value(queryRange(chooseProfileDate.dateValue(), chooseProfileDate.dateValue()));
    }
    else
    {
        profileDateRange.value('');
    }

    super();
}

public boolean modified()
{
    boolean ret;

    ret = super();

    element.refreshGrid();

    return ret;
}

public boolean modified()
{
    boolean ret;

    ret = super();

    element.refreshGrid();

    return ret;
}

void clicked()
{
    JmgErrorSpecificationForm errorSpecificationForm;
    super();
    errorSpecificationForm = new JmgErrorSpecificationForm(jmgStampJournalTrans, element, false);
    errorSpecificationForm.showErrorSpecificationForm();
}
